#include <vector>
#include <string>
using namespace std;

class Solution {
public:
    vector<int> beautifulIndices(string s, string a, string b, int k) {
        vector<int> aIndices, bIndices, result;
        int aLen = a.length(), bLen = b.length();

        // Find all indices where a and b are found in s
        for (int i = 0; i <= (int)s.length() - aLen; ++i) {
            if (s.substr(i, aLen) == a) aIndices.push_back(i);
        }
        for (int i = 0; i <= (int)s.length() - bLen; ++i) {
            if (s.substr(i, bLen) == b) bIndices.push_back(i);
        }

        // Check for each aIndex if a corresponding bIndex exists within range k
        for (int i : aIndices) {
            for (int j : bIndices) {
                if (abs(i - j) <= k) {
                    result.push_back(i);
                    break; // Found a valid b, move to next a index
                }
            }
        }

        return result;
    }
};
